column6:
item_description_1002 (合成、建築升級用素材。

用隨處可見的石頭，打碎後得到的小石子。堅固耐用，雖然不怎麼好看，但也別那麼挑剔了。
)

item_description_1003 (合成、建築升級用素材。

野外求生的好朋友，每個人都該來上一根。
)

item_description_1004 (合成、建築升級、交易用物品。

錢，不管怎麼看都是錢。錢並非無所不能，但沒有錢萬萬不能啊，看到就趕緊收到口袋吧。
)

item_description_1007 (探索用工具、可進行挖掘。

種植與挖掘必須要有的一把鏟子！有時會挖到一些意想不到的東西，不管挖到什麼，都要照單全收。
)

item_description_1008 (探索用工具、可進行開鎖。

什麼寶箱都打得開，什麼鎖都打得開，包括心上人的心門！大概吧。
)

item_description_1009 (探索用工具，可進行採集。

鋒利又輕便，一般來說拿來採集各種植物恰到好處。當然想拿來採集些什麼別的東西也可以喔！啾咪！
)

item_description_1024 (探索用工具、可進行偷竊。

凡泰緹第一衣飾品牌「黑夜」榮譽出品，將天鵝絨剪裁成優雅的黑色手套，受盜竊者及女孩們歡迎。據說某位著名的美少女怪盜就是他們的死忠粉絲。
)

item_description_1035 ((凌亂的筆跡讓你只能辨認出部分)

雖然我還年輕，但我現在跟著的老大很有前途，......在你回應我之前，我每天都會寫一封放在你家門下，直到你被我打動為止。
)

item_description_1036 ((凌亂的筆跡讓你只能辨認出部分)

我甚麼都願意做，砍東西、搶東西、偷東西，.......
)

item_description_1037 (合成用素材。

你可以在哨站消耗本物品獲得一些補給品。
)

item_description_1050 (合成、建築升級用素材。

野獸身上的寶貴資源，能幫助人們抵禦寒冬，溫暖身心。要懷抱一顆虔誠感恩的心好好使用。
)

item_description_1051 (合成、建築升級用素材。

野獸身上的寶貴資源，具有裝飾、保暖等用途。要懷抱一顆虔誠感恩的心好好使用。
)

item_description_1052 (合成用素材。

三大主食之一，不只可以食用，麥稈還可用於編織、綑綁。是生活中不可或缺的作物。食用時記得感謝農夫的辛勞！
)

item_description_1053 (合成用素材。

佈滿晴空草原的野花，見證了草原的日出日落，以及附近村莊的情侶們從談情說愛到吵架分手的過程。來到晴空草原時，不妨採摘一朵回去吧。
)

item_description_1054 (合成用素材。

小小的生命醞釀其中，但很有可能尚未萌芽便成為盤中美食。富含營養，是健康的泉源。
)

item_description_1058 (探索用工具，可進行剝皮。

真好用牌剝皮刀。野外探索時不可或缺的刀具，不管是巨大的野獸或是骨骼精奇的小動物，都能輕易地使其皮肉分離。
)

item_description_1059 (探索用工具，可進行陷阱設置。

將獸牙嵌進木框，再以橡皮繩綁縛製成，能緊緊咬住獵物、讓牠難以脫身。可別不小心放在別人的屁股下了。
)

item_description_1100 (合成用素材。

看起來很像透晶石的岩鹽結晶，多少年來欺騙了無數單純無辜的冒險者們。轉念想想，至少拿來調味還是不錯的啊。
)

item_description_1101 (合成、建築升級用素材。

堅固又美觀的石材，只有在地下深處才會看到。拿來裝潢地板，貴氣頓時上升了一個檔次，銀行家的最愛。
)

item_description_1102 (合成、建築升級用素材。

烏黑、沉重的金屬礦石，受到太陽王國建築、鍛造業的廣泛應用。近年軍備擴張，價格上漲，正是大量買入的時機。
)

item_description_1103 (合成用素材。

在戰鬥中毀損的武器。不知道前任主人遭遇了怎樣的命運……不過反正人家用不到了，在心裡默哀後就不客氣的收下吧。
)

item_description_1104 (合成用素材。

滿是補丁，沒有什麼保暖功能的衣物。似乎是血汗紡織廠的童工超時工作的結果，搞不好會在夾層發現寫了「救命」的紙條。
)

item_description_1105 (合成、建築升級用素材。

粗糙的布匹。材質是不怎麼高級，不過實用性可是一等一！堅韌耐用不掉色，地方媽媽的好幫手！（可水洗）
)

item_description_1108 (探索用工具、可進行採礦。

頂端尖尖的挖掘工具，無論怎樣的頑石都能敲開。要訣是使用腰桿跟後背的力量，小心別閃到腰了！
)

item_description_1121 (生存用憑證。
攜帶在包包時，我方角色獲得一個額外被動：每次本角色的技能賦予一個角色暈眩時，精神值+1。
)

item_description_1122 (生存用憑證。
於深入亞特拉斯關卡，身上帶有板甲護膝，板甲護腕，板甲護肩時，可以進行徵收。
)

item_description_1123 (生存用憑證。
於深入亞特拉斯關卡，當飽食度低於30，身上帶有孤兒的眼淚，可以進行補給請求。
)

item_description_1124 (生存用憑證。
攜帶在包包時，我方角色獲得一個額外被動：戰鬥開始時，每一個魔物，使你精神值+1。
)

item_description_1125 (生存用憑證。
攜帶在包包時，我方角色獲得一個額外被動：每次本角色的技能賦予一個角色中毒時，精神值+1。
)

item_description_1131 (合成、建築升級用素材。

彭列瓦的商人隨時都在成本與利潤間權衡。即使是被退貨的粗布，拆解後也可以加工成首飾販售……什麼黑心，請說這是節約好嗎？
)

item_description_1132 (合成、建築升級用素材。

美麗又貴重的金屬礦石，挖礦者夢寐以求的珍品，也是世上許多罪惡的起源。好心提醒，拿來作成首飾就算了，私鑄庫倫是嚴重的犯罪喔～
)

item_description_1133 (合成、建築升級用素材。

帶著純淨綠色的美麗礦石。為了通過太陽王國邊境，走私販們一度對外宣稱「這是瘀青的鐵礦啦～」
)

item_description_1134 (合成、建築升級用素材。

帶著高貴紅色的美麗礦石。紅色代表著洋溢的熱情，貴族小姐總堅持要見到大顆的紅寶石才答應求婚，實際上只是藉以測試求婚者的財力而已。
)

item_description_1135 (合成、建築升級用素材。

帶著深邃紫色的美麗礦石。是地底下自然生成的石英結晶，跟圖騰塔夫的晶礦是完全不同的東西。你以為可以拿來當作魂晶碎片使用嗎？太天真啦！
)

item_description_1142 (合成、建築升級用素材。

將木材進行初級加工，先用鋸子切開再慢慢的刨平，但不管怎麼樣總會覺得兩邊厚度不一樣，不知不覺就刨得太薄不能用了～
)

item_description_1143 (生存用憑證。
攜帶在包包時，我方角色獲得一個額外被動：戰鬥開始時，若本角色死亡則立即復活至1滴血，精神值+1。
)

item_description_1144 (生存用憑證。
於深入亞特拉斯關卡，玩家身上的補給品文件，可以在哨站換到更好的存貨。
)

item_description_1146 (生存用憑證。
戰鬥開始時，玩家身上每擁有2種礦石，精神值+1。
)

item_description_1147 (生存用憑證。
攜帶在包包時，我方角色獲得一個額外被動：玩家回合開始時，減少1-3精神值，玩家身上每枚庫倫，角色的技能效果增加0.1%。
)

item_description_school_3 (合成用素材。

研磨紅色瑪瑙得到的粉末，蘊藏著充沛的魂能。學院每年花費大量金錢從沙漠市集買進瑪瑙，但偶爾會從狡猾奸商那裡買到硃砂粉做的假貨。
)

item_description_school_4 (合成用素材。

研磨黃色琥珀得到的粉末，蘊藏著充沛的魂能。琥珀當中偶爾封存著古時候的生物，生命學派的實驗會不會哪天讓這些生物重新活動起來呢？
)

item_description_school_5 (合成用素材。

研磨藍色磷石得到的粉末，蘊藏著充沛的魂能。堅硬的磷石不易搗碎，學院的教授通常會用加分為條件叫學生來磨。即使不擅長讀書，有強大的臂力還是能及格的喔！
)

item_description_school_6 (合成用素材。

研磨黑色雲母得到的粉末，蘊藏著充沛的魂能。晶亮的黑色感覺非常高貴，用這種粉末做成的魂能道具似乎特別神秘。
)

item_description_school_7 (合成用素材。

研磨白色石英得到的粉末，蘊藏著充沛的魂能。最近經費縮減，有些公共觀念差的教授會直接拆教室的玻璃窗來磨，冬天覺得冷都是他們的錯！
)

item_description_school_8 (合成用素材。

能將礦石當中的魂能萃取出來的裝置，萃取完可作為魂匣直接使用。由於不將礦石磨成粉就無法萃取，因此為教授增加了許多人力成本，也為學生增添了許多吃力不討好的勞動服務。
)

item_description_school_12 (合成用素材。

隨處可見的普通墨水，從事研究工作不可或缺的文具。近年發現內含成分可以跟礦物粉末調配成魂能道具，引發了一波囤積潮。
)

item_description_forest_1 (合成、建築升級用素材。

來自最結實牢固的主幹，比樹枝更堅固，用途也更廣，如果只是拿來當柴燒就太浪費了。
)

item_description_forest_6 (探索用工具，可進行砍伐。

以脊椎為中心，利用旋轉的慣量與角加速度劈開物體的利器。如果沒有抓緊，旁邊的人就要小心了。
)

item_description_forest_7 (探索用工具，可進行攀爬。

即使是小草，編攏後也能承受極大的重量。無論是樹梢還是圍牆，都能輕輕鬆鬆翻越過去，小毛賊的必備工具。
)

item_description_forest_13 (探索用工具，可進行休息。

受夠了用星空當屋頂、泥土當床的日子嗎？只要簡單的材料就能阻隔夜裡的風寒，讓我們拒絕大自然，回歸文明的醜惡；擁抱人工製品，迎向快樂人生！
)

item_description_forest_17 (合成用素材。

熬煮花瓣、搗碎種子，美麗的花兒被摧殘殆盡，精華凝結成晶瑩的油滴，短暫虛無的美麗化為實用的素材，小花兒是不是覺得很寬慰呢？ 
)

item_description_1y_redmoon_note (字跡潦草的筆記；
似乎是某個飽受噩夢折磨的人所寫下，關於他詭異的夢境的描述。
)

item_description_rune_ash (將其重新組合後能兌換各種獎勵。

重新構築後意外四分五裂的符文碎片；在【巴爾札克的遺產】中，將找到的古代符文交給王國符文師後取得。
)

item_description_scrooll_1y_unwavering (遇到替換隊員時可消耗一個符文書，選擇不更換。

由古代符文字元重新組合而成，只能在【巴爾札克的遺產】發揮作用。
)

item_description_scrooll_1y_extrachoice (選擇符文參謀時可消耗一個符文書，選擇額外的參謀。

由古代符文字元重新組合而成，只能在【巴爾札克的遺產】發揮作用。
)

item_description_scrooll_1y_frugal (每次處理符文時消耗一個符文書，大幅減少消耗的精神值與飽食度。

由古代符文字元重新組合而成，只能在【巴爾札克的遺產】發揮作用。
)

item_description_scrooll_1y_extrasuport (在溫室中可消耗一個符文書，選擇取走所有食物並同時執行休息與用餐。

由古代符文字元重新組合而成，只能在【巴爾札克的遺產】發揮作用。
)

item_description_scrooll_1y_shortcut (可消耗一個符文書，直接移動到曾平安離開的幻境區域。

由古代符文字元重新組合而成，只能在【巴爾札克的遺產】發揮作用。
)

item_description_homeland_11 (房間最重要的就是門面了，為了更多即將入住的夥伴們，先把他們的新家給布置好吧！
......這樣至少不會這麼想逃跑。
)

item_description_homeland_12 (經過防水處理的粗布，可以拿來搭建帳篷，不管下多大的雨，都能讓人一夜好眠。
......嗯，應該啦，如果沒有因豪雨導致山洪暴發的話......
)

item_description_arena_9 (戰鬥用裝備。
攜帶在包包時，戰鬥內泉技能效果增加10%，額外獲得一個被動技能：玩家的第一個回合開始時，本角色施展一、二與四魂技能。
)

item_description_arena_10 (戰鬥用裝備。
攜帶在包包時，戰鬥內龐技能效果增加10%，額外獲得一個被動技能：被攻擊後，本角色與1個隨機金色魂芯獲得轉盾。
)

item_description_arena_11 (戰鬥用裝備。
攜帶在包包時，戰鬥內雪莉技能效果增加10%，額外獲得一個被動技能：每次復活後，飽食度與精神值+10。
)

item_description_arena_12 (戰鬥用裝備。
攜帶在包包時，戰鬥內納杰爾技能效果增加10%，額外獲得一個被動技能：若玩家身上有火把、秘傳溫泉木炭酒與烈火桶，本角色攻擊目標後，賦予其6回合燃燒。
)

item_description_arena_13 (戰鬥用裝備。
攜帶在包包時，戰鬥內莫里斯技能效果增加10%，額外獲得一個被動技能：玩家回合開始時，若有大於等於8個黑色魂芯，本角色施展四魂技能。
)

item_description_arena_15 (戰鬥用裝備。
攜帶在包包時，戰鬥內琉技能效果增加10%，額外獲得一個被動技能：本角色施展治癒技能後，獲得1飽食度。
)

item_description_arena_16 (戰鬥用裝備。
攜帶在包包時，戰鬥內荷絲緹雅技能效果增加10%，額外獲得一個被動技能：玩家回合開始時，游標指定角色的魂芯獲得再生。
)

item_description_arena_17 (戰鬥用裝備。
攜帶在包包時，戰鬥內芙蕾莉卡技能效果增加10%，額外獲得一個被動技能：玩家回合開始時，賦予所有魂芯強化與隨機3個魂芯暈眩。
)

item_description_pier_jewelry (本物品無法帶出小千金大航海。

老管家偷藏起來，價值不斐的美麗戒指，或許可以拿來當作買賣或者交涉的籌碼。
)

item_description_pier_1 (戰鬥用裝備。
攜帶在包包時，戰鬥內盧恩技能效果增加10%，額外獲得一個被動技能：同伴失去暈眩後，施展一魂技能。
)

item_description_pier_2 (戰鬥用裝備。
攜帶在包包時，戰鬥內蘇菲技能效果增加10%，額外獲得一個被動技能：同伴施展三魂技能後賦予其強化與減傷。
)

item_description_pier_3 (戰鬥用裝備。
攜帶在包包時，戰鬥內瑪莉亞技能效果增加10%，額外獲得一個被動技能：玩家回合開始時，若身上為當機狀態，清除所有金色魂芯，若身上為超頻狀態，清除所有黑色或白色魂芯。
)

item_description_pier_4 (戰鬥用裝備。
攜帶在包包時，戰鬥內雷薩技能效果增加10%，額外獲得一個被動技能：同伴施展三魂技能後進入徒手狀態。
)

item_description_pier_5 (戰鬥用裝備。
攜帶在包包時，戰鬥內黛安娜技能效果增加10%，額外獲得一個被動技能：被攻擊後，對敵方指定角色穿透攻擊，並賦予其中毒。
)

item_description_pier_6 (戰鬥用裝備。
攜帶在包包時，戰鬥內米莎技能效果增加10%，額外獲得一個被動技能：有再生的同伴施展三魂技能後，獲得3層再生。
)

item_description_pier_7 (戰鬥用裝備。
攜帶在包包時，戰鬥內戴菲斯技能效果增加10%，額外獲得一個被動技能：玩家回合開始時，有減傷與延命的同伴施展三魂技能。
)

item_description_pier_8 (戰鬥用裝備。
攜帶在包包時，戰鬥內洛技能效果增加10%，額外獲得一個被動技能：同伴施展三魂技能後，怒目增加2層。
)

item_description_pier_9 (戰鬥用裝備。
攜帶在包包時，戰鬥內甲申技能效果增加10%，額外獲得一個被動技能：玩家回合開始時，本角色身上有兩層以上領袖時，隨機同伴施展三魂技能。
)

item_description_19christmas_scroll_cure (來自地下城物語的道具卷軸，水系魔法。可在部分探索戰鬥中直接使用。
恢復我方指定隊友50%最大血量。
)

item_description_19christmas_gumballcake (合成素材，可在合成區合成岡布奧果凍。

名符其實的奶油漿果蛋糕，頗受岡布奧們歡迎的野外甜點。因為添加了酸甜可口的草莓，食用起來別具冒險滋味。          
)

item_description_19christmas_wondergel (合成素材，可在合成區合成奇蹟果凍。

平時被裝在高級容器裡，軟黏不沾手的藍色膠狀物。時至今日，大家依然不知道凝膠的真實成分，只知道用凝膠做成的奇蹟果凍特別好吃。
)

